import classes from "./Info.module.css";
import DonutChart from "react-donut-chart";

function Chart() {
  const width = `80%`;
  const height = `80%`;

  return (
    <DonutChart
      className={classes.dchart}
      width={280}
      height={250}
      innerRadius={0.8}
      selectedOffset={0}
      strokeColor={"#fff"}
      outerRadius={1}
      colors={["#1952383", "#4C66C2", "#95DCAE", "#5CB67B"]}
      data={[
        {
          label: "Freight",
          value: 15,
        },
        {
          label: "Acknowledged",
          value: 30,
        },
        {
          label: "on Hold",
          value: 45,
        },
      ]}
    />
  );
}

export default Chart;
